import React from 'react';
import { Card } from 'react-bootstrap';
import './Product.css'

const Product = ({ product }) => {
  console.log("------>", product)
  return (
    <Card className="my-3 p-3 rounded card">
      <a href={product.link} target="_blank" rel="noreferrer">
        <Card.Img src={product.image} variant="top" id='img-card' />
      </a>

      <Card.Body className="warpper">
        <a href={product.link} target="_blank" rel="noreferrer">
          <Card.Title as="div">
            <strong>{product.title}</strong>
          </Card.Title>
        </a>

        <Card.Text as="div">
          <div className="my-3 text-success font-weight-bold">{product.condition}</div>
        </Card.Text>

        <Card.Text as="div">
          <div className="my-3">
            {product.stock > 0 ? 'In Stock' : 'Out of Stock'}
          </div>
        </Card.Text>

        <Card.Text as="h3" className="pr-5" >
          ${product.price + "  " + product.currency}

        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default Product;
